const LocationList = (spot) => {
  return (
    <table>
      <tr>
        <th>Name</th>
        <th>Country</th>
        <th>Latitude</th>
        <th>Longitude</th>
        <th>Wind Prob.</th>
        <th>When to go</th>
      </tr>
      <tbody>
        {Array.isArray(spot)
          ? spot.map((spot) => (
              <tr>
                <td>Centro comercial Moctezuma</td>
                <td>Francisco Chang</td>
                <td>Mexico</td>
              </tr>
            ))
          : null}
      </tbody>
    </table>
  );
};

export default LocationList;
